import './App.css';
import Box1 from './component/Box1';

function App() {
  let counter = 0;
  return (
    <div>
      <Box1 name="한국"/>
      <Box1 name="미국"/>
      <Box1 name="중국"/>

      <div>{counter}</div>
      <button>클릭!</button>
    </div>
  );
}

export default App;
